import ReactLogo from '../../assets/react.svg';

function Header() {
    return(
        <div className="navbar">
            <ul>
                <li className="title"><img className="reactlogo" alt="" src={ReactLogo}></img>React Apps</li>
                <li className="nav1">Weather info</li>
                <li className="nav1">Memory Game</li>
            </ul>
        </div>
    );

}

export default Header;
